import React from "react";
import Common from "./Common";
import { NavLink } from "react-router-dom";
import web from "../src/images/artboard.png";

const Home = () => {
  return (
    <>
      <Common
        name="Grow your buisness with"
        imgsrc={web}
        visit="/service"
        btnname="Get Started"
      />
    </>
  );
};

export default Home;
